import React from "react";
import './home.css';

import Carousel from 'react-bootstrap/Carousel';

import slide1 from '../../../src/assets/img/chowmin.jpg';
import slide2 from '../../../src/assets/img/egg.jpg';
import slide3 from '../../../src/assets/img/steak.jpg';
import slide4 from '../../../src/assets/img/Ilish-Pulao.5.jpg';
import slide5 from '../../../src/assets/img/thali.jpg';
import slide6 from '../../../src/assets/img/hilsa.jpg';
import slide7 from '../../../src/assets/img/download.jpg';


const getImageNameFromPath = (path) => {
  const parts = path.split('/');
  return parts[parts.length - 1].split('.')[0]; // Extract filename without extension
};
const Home = () => {
  return (
    <div>
      <div className="text-center">
        <h1 className="animated-text">
          <i>
            <b>KITCHENER'S SPELL</b>
          </i>
        </h1>
      </div>
      <div className="row mt-5">
          <section className="slider container mb-3">
            <Carousel>
              <Carousel.Item className='slide'>
                <img
                  className="d-block w-100"
                  style={{ maxHeight: '680px', objectFit: 'cover' }}
                  src={slide1}
                  alt="First slide"
                />
                <Carousel.Caption>
                <h3 style={{color:'red'}}>{getImageNameFromPath(slide1)}</h3>
              </Carousel.Caption>
              </Carousel.Item> 
              <Carousel.Item className='slide'>
                <img
                  className="d-block w-100"
                  style={{ maxHeight: '680px', objectFit: 'cover' }}
                  src={slide2}
                  alt="Second slide"
                />
                  <Carousel.Caption>
                <h3 style={{color:'red'}}>{getImageNameFromPath(slide2)}</h3>
              </Carousel.Caption>
              </Carousel.Item>
              <Carousel.Item className='slide'>
                <img
                  className="d-block w-100"
                  style={{ maxHeight: '680px', objectFit: 'cover' }} 
                  src={slide3}
                  alt="Third slide"
                />
              </Carousel.Item>

              <Carousel.Item className='slide'>
                <img
                  className="d-block w-100" 
                  style={{ maxHeight: '680px', objectFit: 'cover' }}
                  src={slide4}
                  alt="Fourth slide"
                />
              </Carousel.Item>

              <Carousel.Item className='slide'>
                <img
                  className="d-block w-100" 
                  style={{ maxHeight: '680px', objectFit: 'cover' }}
                  src={slide5}
                  alt="Fifth slide"
                />
              </Carousel.Item>

              <Carousel.Item className='slide'>
                <img
                  className="d-block w-100" 
                  style={{ maxHeight: '680px', objectFit: 'cover' }}
                  src={slide6}
                  alt="Sixth slide"
                />
              </Carousel.Item>
              <Carousel.Item className='slide'>
                <img
                  className="d-block w-100" 
                  style={{ maxHeight: '680px', objectFit: 'cover' }}
                  src={slide7}
                  alt="Seventh slide"
                />
              </Carousel.Item>
            </Carousel> 
          </section>
        
      </div>
      <div className="row mt-5 text-center">
       <div className="col">
        <h1 style={{color:'purple'}}>Most Popular Food here...</h1>
       </div>
      </div>
    </div>
  )
}

export default Home;
